import CardService from './CardService';
import {Container, Row, Col} from 'reactstrap';

class CardFrame extends Component {
    state={
        vaga:[
            {categoria: "vaga de voluntariado", nomedavaga:"Arrecadação de Alimentos para Moradores de Rua", empresa: "SP Invisível", number:"2-6",subText:"Vagas Disponíveis", cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Arrecadação de Alimentos para Moradores de Rua", empresa: "SP Invisível", number:"2-6",subText:"Vagas Disponíveis", cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Entrega de Roupas e Alimentos", empresa: "SP Invisível", number:"2-6",subText:"Vagas Disponíveis", cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Entrega de Roupas e Alimentos", empresa: "SP Invisível", number:"2-6",subText:"Vagas Disponíveis", cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Arrecadação de Alimentos para Moradores de Rua", empresa: "SP Invisível", number:"2-6",subText:"Vagas Disponíveis", cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Entrega de Roupas e Alimentos", empresa: "SP Invisível", number:"2-6", cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Arrecadação de Alimentos para Moradores de Rua", empresa: "SP Invisível", number:"2-6", subText:"Vagas Disponíveis",cidade:"Natal, RN"} ,
            {categoria: "vaga de voluntariado", nomedavaga:"Entrega de Roupas e Alimentos", empresa: "SP Invisível", number:"2-6", subText:"Vagas Disponíveis", cidade:"Natal, RN"} ,
        ]


    }

    render() {
        let details=this.state.vaga.map(singleVaga=>{
            return(
                <Col>
                <CardService details ={singleVaga} />
                </Col>
            )
        })
    return(
<div>
    <Container>
        <Row>
            {details}
        </Row>
    </Container>
</div>

    )

    }
}

export default CardFrame;
